import React from 'react';
import ReactDOM from 'react-dom';

let b = new Date();
b = b.getHours();
let c = '';

if (b >= 0 && b < 12) {
    c = 'Good Morning';
}
else if (b >= 12 && b < 5) {
    c = 'Good Afternoon';
}
else if (b >= 5 && b < 8) {
    c = 'Good evening';
}
else {
    c = 'Good Night';
}

ReactDOM.render(
    <>
        <h1>Hello sir, </h1>
    </>,
